  false,\n\t\"url\": null,\n\t\"notes\": \"The marbled murrelet (Brachyramphus marmoratus
  marmoratus) is a year-round resident on Washington marine coastal waters within
  several kilometers of the shoreline. Marbled murrelets require large limbs or similar
  canopy structures for nesting and stand-level structural complexity that is found
  in mature and old-growth coniferous and mixed species forests. Occupied sites are
  typically found within 39 miles (63 kilometers) of marine waters. Removal of these
  forests, primarily by timber harvesting and urbanization, is the principle factor
  contributing to the decline of the marbled murrelet, and is the most significant
  impediment to recovery of the species (USFWS 1997). The marbled murrelet is federally
  listed as a threatened species in California, Oregon and Washington. The state of
  Washington has also listed the marbled murrelet as threatened.\",\n\t\"license_title\":
